  `isFreeExchange` tinyint(4) DEFAULT '0' COMMENT '0包退 1不包退',
  `isVIP` tinyint(4) DEFAULT '0' COMMENT '是否为VIP专享  0非VIP专享',
  `status` tinyint(4) DEFAULT '0' COMMENT '拍品状态 0上架  1下架',
