  KEY `owner_id` (`owner_id`),
  KEY `goods_bak_id` (`goods_bak_id`),
  KEY `status` (`status`),
  KEY `isCreateOrder` (`isCreateOrder`),
  KEY `isRemind` (`isRemind`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8mb4;

