  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '序号',
  `rechargeId` varchar(20) NOT NULL DEFAULT '' COMMENT '充值ID',
  `userId` int(10) NOT NULL DEFAULT '0' COMMENT '充值用户ID',
  `price` float(10,2) DEFAULT '0.00' COMMENT '充值金额',
